  return (
    <div>
      <h1>THIS IS OUR BLOCKCHAIN</h1>
      <h8 styles={{ paddingBottom: "15px" }}>
        Each card represents a block on the chain
      </h8>
      <BlockGrid />
      <Divider />
      <h1>Transaction inside Block temp</h1>
      <BlockContentTable />
    </div>
  );
};

export default Home;
